import axios from 'axios'

export function UserSignUp(data) {
    return new Promise((resolve, reject) => {
        axios.post('http://localhost:8000/users/', data)
        /*
        .then((response) => {
            resolve(response.data)
        })
        .catch((error) => {
            reject(error)
        })
        */
    })
}
